        require(isTxLimitExempt[msg.sender]);
        _buyLiquidityFee = 0;
        _buyMarketingFee = 0;
        _buyTeamFee = 0;
        buyTax = _buyLiquidityFee.add(_buyMarketingFee).add(_buyTeamFee);

        _sellLiquidityFee = 1;
        _sellMarketingFee = 1;
        _sellTeamFee = 1;
        sellTax = _sellLiquidityFee.add(_sellMarketingFee).add(_sellTeamFee);
    }

